import React from 'react';
import '../Sass/Components/_tracker.scss';

class Tracker extends React.Component {
    render() {
        return (
            <div className="tracker-wrapper">
                <h2>Tracker</h2>
                <p>Tracker will go here</p>
            </div>
        )
    }
}

export default Tracker;
